import React from 'react';
import './Menu.css';
import Fab from '@material-ui/core/Fab';
import NavigationIcon from '@material-ui/icons/Navigation';


export default class Menu extends React.Component{
    render(){
        return(
            <div className="Menu">
                <Fab aria-label="Delete">
                    <NavigationIcon />

                </Fab>
            </div>
        );
    }
}
